import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for any "Electronics" category navigation element
    // Try to find a visible category card with "Electronics"
    const electronicsCard = await page.waitForSelector(
      "//div[contains(@class,'category-card')][contains(.,'Electronics')]",
      { timeout: 5000 }
    );

    // Take screenshot before clicking
    const beforeClickShot = path.join(screenshotsDir, 'step_2_before_click_electronics.png');
    await page.screenshot({ path: beforeClickShot });
    screenshots.push(beforeClickShot);

    // Click the Electronics category card
    await electronicsCard.click();

    // Wait for the main content to update to Electronics category
    // Look for a heading or text indicating Electronics category is shown
    // Try to find an h2 or div with "Electronics" as heading
    await page.waitForSelector(
      "//*[self::h2 or self::div][contains(text(), 'Electronics')]",
      { timeout: 5000 }
    );

    // Take screenshot after navigation
    const afterNavShot = path.join(screenshotsDir, 'step_3_after_navigate_electronics.png');
    await page.screenshot({ path: afterNavShot });
    screenshots.push(afterNavShot);

    // Extract the number of products shown in Electronics category (if available)
    let productCount = null;
    try {
      // Try to find a results-count element
      const countElem = await page.$("div.results-count");
      if (countElem) {
        const countText = await countElem.textContent();
        productCount = countText;
      }
    } catch (e) {
      // ignore extraction error
    }

    return {
      success: true,
      action: "Navigated to Electronics category via category card and verified category page loaded",
      extractedData: {
        productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
